Model  PA-08 TR with light mount and sling swivels.   Chambered for 12 GA 2-3/4 or 3 inch shells.  5-shot in NIB condition but for a couple of very minor scuffs on the receiver.  Just don't need this so am selling or willing or trade (in-part) for what I really want in the way of a nice black powder muzzle loading replica ONLY (in order of preference):

1.  Lemat replica cap-and-ball revolver;
2.  Replica Sharps or similar black powder muzzle loader; 
3.  Replica 1874 Trapdoor 45-70 carbine.

This is a I "want" to trade/sell, not an "I gotta"  so no low-ball offers nor offers to trade for a modern firearm.  Also, I really prefer not to make any negotiations (offers) sight unseen please.   These photos do no do the shotgun justice and it is already priced fairly.
